        public int FindMaxConsecutiveOnes(int[] nums)
        {
            int localMax = 0;
            int localMax2 = 0;
            int max = 0;
            int i = 0;
            while (i < nums.Length)
            {
                var num = nums[i++];

                if (num == 0)
                {
                    max = Math.Max(max, localMax);

                    localMax = localMax2;
                    localMax++;

                    localMax2 = 0;
                }
                else
                {
                    localMax++;
                    localMax2++;
                }
            }

            return Math.Max(max, localMax);
        }
    }
